goog.require("axs.AuditRules");goog.require("axs.browserUtils");goog.require("axs.constants.Severity");goog.require("axs.utils");axs.AuditRules.addRule({name:"multipleAriaOwners",heading:"An element's ID must not be present in more that one aria-owns attribute at any time",url:"https://github.com/GoogleChrome/accessibility-developer-tools/wiki/Audit-Rules#ax_aria_07",severity:axs.constants.Severity.WARNING,relevantElementMatcher:function(element){return axs.browserUtils.matchSelector(element,"[aria-owns]")},test:function(element){var attr="aria-owns",ownedElements=axs.utils.getIdReferents(attr,element);return ownedElements.some(function(ownedElement){var owners=axs.utils.getAriaIdReferrers(ownedElement,attr);return 1<owners.length})},code:"AX_ARIA_07"});